import React, { Fragment } from 'react';
import './App.css';
import Box from '@material-ui/core/Box';
import books from './books.jpg';



function Home() {
  return (
    <div 
      style={{
        backgroundImage:`url(${books})`
    }}>
      <Box component="span" color="orange" m={1}>
        <h1>Welcome to Breakdown!</h1>
      </Box>
    </div>
    
  );
}

export default Home;
